import {makePostHelper} from "../javascript/Server"

const Expect = (func,...args) =>  {
    try {
        func(args)
    } catch (exception) {
        return exception
    }
}

const testMakePost = () => {
    const flawPostObj = {
        author : "Wonjae Lee"
    }

   Expect(makePostHelper, "testPosts")
}

export const runTests = () => {
    testMakePost();
}
